DROP TABLE IF EXISTS `dims_region`;
CREATE TABLE IF NOT EXISTS `dims_region` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` int(3) NOT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

DROP TABLE IF EXISTS `dims_departement`;
CREATE TABLE IF NOT EXISTS `dims_departement` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(3) NOT NULL,
  `code_reg` int(3) NOT NULL,
  `name` varchar(255) NOT NULL,
  `pop_2006` int(8) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

DROP TABLE IF EXISTS `dims_canton`;
CREATE TABLE IF NOT EXISTS `dims_canton` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code_dep` varchar(3) NOT NULL,
  `code_reg` int(3) NOT NULL,
  `code_arrond` int(2) NOT NULL,
  `code` int(3) NOT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

DROP TABLE IF EXISTS `dims_arrondissement`;
CREATE TABLE IF NOT EXISTS `dims_arrondissement` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code_dep` varchar(3) NOT NULL,
  `code_reg` int(3) NOT NULL,
  `code` int(3) NOT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

