-- Matrice --
ALTER TABLE `dims_matrix` ADD `id_canton` INT( 11 ) NOT NULL DEFAULT '0' AFTER `id_city` ,
ADD `id_arrondissement` INT( 11 ) NOT NULL DEFAULT '0' AFTER `id_canton` ,
ADD `id_departement` INT( 11 ) NOT NULL DEFAULT '0' AFTER `id_arrondissement` ,
ADD `id_region` INT( 11 ) NOT NULL DEFAULT '0' AFTER `id_departement` ;

UPDATE `dims_matrix` m
INNER JOIN `dims_city` c
ON c.id = m.id_city
LEFT JOIN `dims_departement` d
ON d.code = c.code_dep
AND d.code_reg = c.code_reg
LEFT JOIN `dims_region` r
ON r.code = c.code_reg
LEFT JOIN `dims_arrondissement` a
ON a.code = c.code_arrondissement
AND a.code_reg = c.code_reg
AND a.code_dep = c.code_dep
LEFT JOIN `dims_canton` ca
ON ca.code = c.code_canton
AND ca.code_reg = c.code_reg
AND ca.code_dep = c.code_dep
AND ca.code_arrond = c.code_arrondissement
SET m.id_canton = ca.id_globalobject, m.id_arrondissement = a.id_globalobject, m.id_departement = d.id_globalobject, m.id_region = r.id_globalobject
WHERE m.id_city > 0;

